-- ============================================================================
-- Update Patient Locations
-- Ensure ALL patients use only the 5 allowed districts with real villages
-- Distributes all 747 patients evenly across 5 districts
-- ============================================================================

UPDATE `person` p
INNER JOIN `patient` pt ON p.person_id = pt.person_id
SET 
    p.district = CASE 
        WHEN MOD(pt.patient_id, 5) = 0 THEN 'Mukono'
        WHEN MOD(pt.patient_id, 5) = 1 THEN 'Buikwe'
        WHEN MOD(pt.patient_id, 5) = 2 THEN 'Jinja'
        WHEN MOD(pt.patient_id, 5) = 3 THEN 'Kampala'
        ELSE 'Wakiso'
    END,
    p.subcounty = CASE 
        WHEN MOD(pt.patient_id, 5) = 0 THEN 
            CASE MOD(pt.patient_id, 2)
                WHEN 0 THEN 'Mukono Central'
                ELSE 'Nakifuma'
            END
        WHEN MOD(pt.patient_id, 5) = 1 THEN 
            CASE MOD(pt.patient_id, 2)
                WHEN 0 THEN 'Najja'
                ELSE 'Lugazi'
            END
        WHEN MOD(pt.patient_id, 5) = 2 THEN 'Jinja Central'
        WHEN MOD(pt.patient_id, 5) = 3 THEN 'Kampala Central'
        ELSE 
            CASE MOD(pt.patient_id, 2)
                WHEN 0 THEN 'Wakiso Central'
                ELSE 'Entebbe'
            END
    END,
    p.parish = CASE 
        WHEN MOD(pt.patient_id, 5) = 0 THEN 
            CASE MOD(pt.patient_id, 4)
                WHEN 0 THEN 'Mukono Town'
                WHEN 1 THEN 'Mukono Town'
                WHEN 2 THEN 'Seeta'
                ELSE 'Namanve'
            END
        WHEN MOD(pt.patient_id, 5) = 1 THEN 
            CASE MOD(pt.patient_id, 2)
                WHEN 0 THEN 'Najja'
                ELSE 'Lugazi Town'
            END
        WHEN MOD(pt.patient_id, 5) = 2 THEN 
            CASE MOD(pt.patient_id, 2)
                WHEN 0 THEN 'Jinja Town'
                ELSE 'Masese'
            END
        WHEN MOD(pt.patient_id, 5) = 3 THEN 
            CASE MOD(pt.patient_id, 3)
                WHEN 0 THEN 'Kololo'
                WHEN 1 THEN 'Kireka'
                ELSE 'Bweyogerere'
            END
        ELSE 
            CASE MOD(pt.patient_id, 2)
                WHEN 0 THEN 'Wakiso Town'
                ELSE 'Entebbe Town'
            END
    END,
    p.village = CASE 
        WHEN MOD(pt.patient_id, 5) = 0 THEN 
            CASE MOD(pt.patient_id, 4)
                WHEN 0 THEN 'Kigombya'
                WHEN 1 THEN 'Ntinda'
                WHEN 2 THEN 'Seeta'
                ELSE 'Namanve'
            END
        WHEN MOD(pt.patient_id, 5) = 1 THEN 
            CASE MOD(pt.patient_id, 2)
                WHEN 0 THEN 'Najja'
                ELSE 'Lugazi'
            END
        WHEN MOD(pt.patient_id, 5) = 2 THEN 
            CASE MOD(pt.patient_id, 2)
                WHEN 0 THEN 'Jinja Town'
                ELSE 'Masese'
            END
        WHEN MOD(pt.patient_id, 5) = 3 THEN 
            CASE MOD(pt.patient_id, 3)
                WHEN 0 THEN 'Kololo'
                WHEN 1 THEN 'Kireka'
                ELSE 'Bweyogerere'
            END
        ELSE 
            CASE MOD(pt.patient_id, 2)
                WHEN 0 THEN 'Wakiso Town'
                ELSE 'Entebbe'
            END
    END;

-- ============================================================================
-- Insert Patient-CAG Relationships
-- Map patients to CAGs in their own village
-- Each patient is assigned to a CAG in their village (district, subcounty, parish, village match)
-- If multiple CAGs exist in the village, assign evenly using patient_id modulo
-- ============================================================================

SELECT 
    p.patient_id,
    cag_assignments.cag_id,
    p.enrollment_date AS join_date,
    'Member' AS role_in_cag,
    CASE 
        WHEN p.current_status = 'Active' THEN TRUE
        ELSE FALSE
    END AS is_active,
    CASE 
        WHEN p.current_status IN ('Dead', 'Transferred-Out', 'LTFU') THEN 
            COALESCE(
                (SELECT MAX(visit_date) FROM visit WHERE patient_id = p.patient_id),
                (SELECT MAX(dispense_date) FROM dispense WHERE patient_id = p.patient_id),
                p.enrollment_date
            )
        ELSE NULL
    END AS exit_date,
    CASE 
        WHEN p.current_status = 'Dead' THEN 'Death'
        WHEN p.current_status = 'Transferred-Out' THEN 'Transferred'
        WHEN p.current_status = 'LTFU' THEN 'Lost to Follow-Up'
        ELSE NULL
    END AS exit_reason
FROM patient p
INNER JOIN person per ON p.person_id = per.person_id
INNER JOIN (
    SELECT 
        c.cag_id,
        c.district,
        c.subcounty,
        c.parish,
        c.village,
        ROW_NUMBER() OVER (
            PARTITION BY c.district, c.subcounty, c.parish, c.village 
            ORDER BY c.cag_id
        ) - 1 AS cag_index,
        COUNT(*) OVER (
            PARTITION BY c.district, c.subcounty, c.parish, c.village
        ) AS total_cags
    FROM cag c
    WHERE c.status = 'Active'
) cag_assignments ON cag_assignments.district = per.district
    AND cag_assignments.subcounty = per.subcounty
    AND cag_assignments.parish = per.parish
    AND cag_assignments.village = per.village
    AND MOD(p.patient_id, cag_assignments.total_cags) = cag_assignments.cag_index
WHERE per.district IN ('Mukono', 'Buikwe', 'Jinja', 'Kampala', 'Wakiso');

-- Set coordinators for each CAG automatically (first active member by join_date)
-- This ensures every CAG has a coordinator
UPDATE `cag` c
SET `coordinator_patient_id` = (
    SELECT patient_id FROM patient_cag 
    WHERE cag_id = c.cag_id 
      AND is_active = TRUE 
    ORDER BY join_date ASC 
    LIMIT 1
)
WHERE c.status = 'Active';

-- Update coordinator roles in patient_cag for all CAGs
UPDATE `patient_cag` pc
INNER JOIN `cag` c ON pc.cag_id = c.cag_id AND pc.patient_id = c.coordinator_patient_id
SET pc.role_in_cag = 'Coordinator'
WHERE c.coordinator_patient_id IS NOT NULL;

-- ============================================================================
-- Insert Sample CAG Rotations
-- Create rotation records for CAG members picking up medications
-- Multiple rotations per CAG to show realistic rotation patterns
-- ============================================================================

SELECT 
    pc.cag_id,
    pc.patient_id AS pickup_patient_id,
    d.dispense_date AS rotation_date,
    d.dispense_id,
    GREATEST(3, LEAST(6, (SELECT COUNT(*) FROM patient_cag pc2 WHERE pc2.cag_id = pc.cag_id AND pc2.is_active = TRUE))) AS patients_served,
    CONCAT('CAG rotation: ', c.cag_name, ' - ', per.first_name, ' ', per.last_name, ' picked up medications')
FROM patient_cag pc
INNER JOIN cag c ON pc.cag_id = c.cag_id
INNER JOIN patient p ON pc.patient_id = p.patient_id
INNER JOIN person per ON p.person_id = per.person_id
INNER JOIN dispense d ON pc.patient_id = d.patient_id
WHERE pc.is_active = TRUE
  AND pc.role_in_cag IN ('Coordinator', 'Member')
  AND p.current_status = 'Active'
  AND d.dispense_date >= '2022-01-01'
  AND d.dispense_date <= '2024-12-31'
  AND MOD(d.dispense_id, 5) = 0  -- Sample every 5th dispense for more rotations
ORDER BY pc.cag_id, d.dispense_date
LIMIT 200;  -- Increased to 200 rotation records

SET FOREIGN_KEY_CHECKS = 1;
COMMIT;